import React from 'react'

import SearchList from './searchList'

const Search = () =>{

    return(
        <div>
            <span className="back-icon" onClick={()=>Navigate(-1)}>
                <i className="back-icon iconfont icon-back"></i>
            </span>
            <SearchList/>
        </div>
    )
}

export default Search
